import React, { useState } from 'react';
import Top from '../style/Top';
import Bottom from '../style/Bottom';
import '../App.css';
function App() {

    const[Number,setNumber]=useState(1);
    const addNumber=()=>{
        setNumber(Number+1)
    }
    return (

            <div className='container'>
            <h1>최상단 화면</h1>
            <Top Number={Number}/>  
            <Bottom  addnumber={addNumber}/>
            </div>
    );
}

export default App;
